//Given a 2D board containing 'X' and 'O' (the letter O), capture all regions surrounded by 'X'.
//
//A region is captured by flipping all 'O's into 'X's in that surrounded region.
//
//For example,
//    X X X X
//    X O O X
//    X X O X
//    X O X X
//After running your function, the board should be:
//
//    X X X X
//    X X X X
//    X X X X
//    X O X X

#include <iostream>
#include <vector>

using namespace std;

class Solution_130 {
public:
    // DFS
    // Exp: https://discuss.leetcode.com/topic/17224/a-really-simple-and-readable-c-solution-only-cost-12ms
    // Time:	O(n)
    // Space:	O(1)
    void solve(vector<vector<char>>& board) {
        if (board.empty() || board.size() == 1) return;
        int m = board.size(), n = board[0].size();
        for (int i = 0; i < m; i++) {
            if (board[i][0] == 'O') mark(board, i, 0);
            if (board[i][n-1] == 'O') mark(board, i, n-1);
        }

        for (int j = 0; j < n; j++) {
            if (board[0][j] == 'O') mark(board, 0, j);
            if (board[m-1][j] == 'O') mark(board, m-1, j);
        }


        for (int i = 0; i < m; i++)
            for (int j = 0; j < n; j++)
                if (board[i][j] == 'O')
                    board[i][j] = 'X';

        for (int i = 0; i < m; i++)
            for (int j = 0; j < n; j++)
                if (board[i][j] == '1')
                    board[i][j] = 'O';

    }

    void mark(vector<vector<char>>& board, int x, int y) {
        board[x][y] = '1';
        int m = board.size(), n = board[0].size();
        if (x > 1 && board[x-1][y] == 'O')  // x > 1: to avoid stack overflow
            mark(board, x-1, y);
        if (x < m - 2 && board[x+1][y] == 'O')  // x < m - 2: to avoid stack overflow
            mark(board, x+1, y);
        if (y > 1 && board[x][y-1] == 'O')  // y > 1: to avoid stack overflow
            mark(board, x, y-1);
        if (y < n - 2 && board[x][y+1] == 'O')  // y < n - 2: to avoid stack overflow
            mark(board, x, y+1);
    }
};


